import React from 'react'

const Thumbnail = (props) => {
  return (
    <div className='project-container'>
      <img className='project-photo' src={props.image} alt={props.name}/>
      <p className='project-title' >{props.name}</p>
    </div>
  )
}

export default Thumbnail
